import React from 'react';
import { useParams } from 'react-router-dom';
import {data} from './data';
import { useState } from 'react';


export const User = (imie:any) =>{
    const {id} = useParams();



    const user = data.find((data) => data.name === id)

    return(
        <div>


            {
                user ? 
                <div>
                    Name: {user.name}
                    Age: {user.age}
                    city: {user.city}
                </div> : null
            }

        </div>

    )
}
